import React from 'react';
import AdminNavigation from '../../components/AdminNavigation'
import { withStyles, makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const StyledTableCell = withStyles((theme) => ({
  head: {
    backgroundColor: theme.palette.common.black,
    color: theme.palette.common.white,
  },
  body: {
    fontSize: 14,
  },
}))(TableCell);

const StyledTableRow = withStyles((theme) => ({
  root: {
    '&:nth-of-type(odd)': {
      backgroundColor: theme.palette.action.hover,
    },
  },
}))(TableRow);

function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Eclair', 262, 16.0, 24, 6.0),
  createData('Cupcake', 305, 3.7, 67, 4.3),
  createData('Gingerbread', 356, 16.0, 49, 3.9),
];

const useStyles = makeStyles({
  table: {
    minWidth: 700,
  },
});

class VaccineRecord extends React.Component {
     
// constructor(){
//     super();
//     this.state={
//         items:[],
//         isLoaded:false,
//     }
// }
//   componentDidMount() {
//     const apiUrl = 'http://localhost:3001/vaccine';
//     fetch(apiUrl)
//       .then((response) => response.json())
//       .then(json =>{
//           this.setState({
//               isLoaded:true,
//               items : json
//           })
//       })}
    //   console.log('This is your data', data));

  render()
  {const classes = useStyles();
  
    var { isLoaded, items} = this.state;
    if(!isLoaded){
        return <div>Loading....</div>
    }
    else{
    return( 
        <div>
          <AdminNavigation />
    <h1>my Component has Mounted, Check the browser 'console' </h1>
    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell>Dessert (100g serving)</StyledTableCell>
            <StyledTableCell align="right">Calories</StyledTableCell>
            <StyledTableCell align="right">Fat&nbsp;(g)</StyledTableCell>
            <StyledTableCell align="right">Carbs&nbsp;(g)</StyledTableCell>
            <StyledTableCell align="right">Protein&nbsp;(g)</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <StyledTableRow key={row.name}>
              <StyledTableCell component="th" scope="row">
                {row.name}
              </StyledTableCell>
              <StyledTableCell align="right">{row.calories}</StyledTableCell>
              <StyledTableCell align="right">{row.fat}</StyledTableCell>
              <StyledTableCell align="right">{row.carbs}</StyledTableCell>
              <StyledTableCell align="right">{row.protein}</StyledTableCell>
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>




    {/* <ul style={{marginLeft:400}}>
        {items.map(item =>(
            <li key={item.id}>

                Vaccine_id:{item.vaccine_id}
                   Vaccine Name:{item.title}
                   Manufacturer:{item.manf}
                   BactchNo:{item.batch}
                   Production Date:{item.p_date}
                   Vaccination Center Id:{item.vc_id}
                   Vaccine Availability:{item.available}
            </li>

            
        ))}
    </ul> */}

    {/* {
        this.state.data ?
        this.state.data.map((item,i)=>
        <div><p>
        {i}--
        {item.vaccine_id}
        {item.title}
        </p></div>)
        :
        null
    } */}

</div>
    )
}
  }
}
export default VaccineRecord;
